import React from "react"
import PrimarySearchAppBar from "../component/Navbar"
import { Box, Typography } from "@mui/material"
import styled from "styled-components"



const SectionFirst=styled(Box)`
  position: relative;
  top: 73px;



`
const BoxFirst = styled(Box)`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  margin-top: 12px;
  border-bottom: 1px solid #8080807d;
`
const HomeSection=styled(Box)`
  margin-top: 12px;
`
const HomeImageSection=styled(Box)`


::after{
  width: 597px;
    content: " ";
    background-image: url(../image/7366082.jpg);
    position: absolute;
    left: 200px;
    top: 42px;
    height: 472px;
    background-position: center;
    background-repeat: no-repeat;
    background-size: contain;
    z-index: -1;

}
`

export const HomeScreen = () => {
  return (
    <>
      <PrimarySearchAppBar></PrimarySearchAppBar>
      <SectionFirst>
        <BoxFirst >
          <Box>
            <Typography variant="subtitle1" >Mobile</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Electronics</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Fashion</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Furniture</Typography>
          </Box>
        </BoxFirst>
        </SectionFirst>
        <HomeSection>
          <HomeImageSection></HomeImageSection>


        </HomeSection>




    </>
  )
}
